        <h1 class="western" style="margin-top: 0in; margin-bottom: 0in"><a name="_jphjsxd13vyn"></a>
            How it Works</h1>
        <h2 class="western" style="margin-top: 0in; margin-bottom: 0in"><a name="_nivzgusw6uon"></a>
            What are KPIs?</h2>
        <p style="margin-bottom: 0in; line-height: 115%">Key Performance
            Indicators, or KPIs in abbreviation, is a type of performance
            measurement, a set of quantifiable measures used to gauge an
            organization’s or company’s performance over time. These metrics
            can be used to determine an organization’s progress in achieving
            it’s strategic and operational goals and also to compare an
            organization’s finances and performance against other organizations
            of the same scope<a class="sdfootnoteanc" name="sdfootnote1anc" href="#sdfootnote1sym"><sup>1</sup></a>.
        </p>
        <p style="margin-bottom: 0in; line-height: 115%">On the case of
            Public Administration Organizations, such as Local City Councils,
            Municipalities, or other higher level authorities, KPIs can provide
            useful information about an organization’s performance. We live in
            a period where fiscal transparency is a major issue. The overall Open
            Data movement has droved governments and local authorities around the
            world to publish their data, and especially fiscal data, in order to
            promote transparency. But these data, in raw format, can be difficult
            to handle by average people. KPIs are  a compressed form of
            information. Huge volume of fiscal data can be summarized in a
            standardized way, offering a quick overview and better understanding
            and study over an authority’s effectiveness and performance, as it
            is reflected by the published fiscal data.</p>
        <h3 class="western" style="margin-top: 0in; margin-bottom: 0in"><a name="_9jlqthfmtasf"></a>
            Greek Municipalities Use Case</h3>
        <p style="margin-bottom: 0in; line-height: 115%">In the case of Greek
            Local authorities (OTA)<a class="sdfootnoteanc" name="sdfootnote2anc" href="#sdfootnote2sym"><sup>2</sup></a>,
            they are obligated by law, to publish their budgets in a standard
            form. A 4 level hierarchical classification exists for each level of
            OTA (2 levels, municipalities and Regional Units), describing
            different aspects of budgetary items called KAE (Coded Classification
            of Revenues/Expenditure). Local authorities publish their budgetary
            data with respect to these standards every year since 2010, and in
            some cases even earlier, classifying their data as extensions of KAE.
            Additionally, Greek Government has defined a number of KPIs, by which
            Local Authorities budgets are monitored for their effectiveness and
            performance on the context of their budgets. In general, KPIs on
            their simplest form are defined as divisions between different
            aggregates of budget data, or demographic data. We can group KPIs,
            used by the Greek Government in four groups:</p>
        <p style="margin-left: 0.5in; text-indent: -0.25in; margin-bottom: 0in; line-height: 115%">
            ●     Per Population Income/Expense Indicators</p>
        <p style="margin-left: 0.5in; text-indent: -0.25in; margin-bottom: 0in; line-height: 115%">
            ●     Correlation of Income - Expenses Indicators</p>
        <p style="margin-left: 0.5in; text-indent: -0.25in; margin-bottom: 0in; line-height: 115%">
            ●     Human Resources Indicators</p>
        <p style="margin-left: 0.5in; text-indent: -0.25in; margin-bottom: 0in; line-height: 115%">
            ●     Structural Indicators</p>
        <h3 class="western" style="margin-top: 0.17in; margin-bottom: 0.03in; line-height: 115%; page-break-inside: auto; page-break-after: auto"><a name="_4079peixfhht"></a>
            Per Population Income/Expense Indicators</h3>
        <p style="margin-bottom: 0in; line-height: 115%">These are Indicators
            that are measuring different items of an organization’s budget per
            capita. For instance Total expenses per Capita measures shows the
            total amount spent by the authority per capita. Investment per capita
            expresses the sum of investments that corresponds in each resident.
            It expresses that is to say the sum per resident that dedicates the
            Municipality on average for investments.</p>
        <h3 class="western" style="margin-top: 0.17in; margin-bottom: 0.03in; line-height: 115%; page-break-inside: auto; page-break-after: auto"><a name="_xj4d2ljifajg"></a>
            Correlation of Income - Expenses Indicators</h3>
        <p style="margin-bottom: 0in; line-height: 115%">Correlation
            Indicators are measuring the how a specific amount of a budget
            correlates to another. For instance, Subsidies Over Total Expenses is
            defined as the quotient subsidies over total expenses and denotes the
            percentage of the total costs of the municipality Total Expenses
            covered by subsidies. The higher the index value, the greater the
            grants participation to the expenses of a municipality and therefore
            the more dependent is the municipality on subsidies.</p>
        <h3 class="western" style="margin-top: 0.17in; margin-bottom: 0.03in; line-height: 115%; page-break-inside: auto; page-break-after: auto"><a name="_yyc7ymj7u5s"></a>
            Human Resources Indicators</h3>
        <p style="margin-bottom: 0in; line-height: 115%">HR Indicators
            measure the percentage of participation of employment costs over
            total expenses or Operational Costs. The Employment Cost index in
            terms of costs is defined as the quotient of Employment cost over
            Total Expenses and expresses the cost of the total payroll staff in
            relation to the total expenditure. The higher the index, the smaller
            is the possibility of investment municipality and this may be due,
            either to higher costs per employee, or a large number of workers.
            Therefore, the smaller the value of this index, the greater the
            possibility the municipality to invest.</p>
        <h3 class="western" style="margin-top: 0.17in; margin-bottom: 0.03in; line-height: 115%; page-break-inside: auto; page-break-after: auto"><a name="_pn1togm4q8cy"></a>
            Structural Indicators</h3>
        <p style="margin-bottom: 0in; line-height: 115%">These indicators are
            showing the percentage of participation of a budget item to the
            total. For instance Revenue structure shows the percentage of
            participation of each revenue item to the sum of all revenue.
            Moreover, Autonomy Indicator expresses the participation of regular
            revenue to the total revenue. As much as higher the index value, the
            greater autonomy has the municipality in budgetary matters and
            financial management as it relies in regularly revenues, which are
            predictable revenue streams. On the other hand, shrinking offs may
            indicate reduced investment activity, as well as investment grants
            are included in extraordinary income.</p>
