            between different values of the three dimensions, organization,
            budget phase and indicator. Make your selection from the form and
            click on the purple plus action button, next of the submit button. 
        </p>
        <p style="margin-bottom: 0in; line-height: 115%"><br/>

        </p>
        <p align="center" style="margin-bottom: 0in; line-height: 115%"><br/>

        </p>
        <p style="margin-bottom: 0in; line-height: 115%">Each series can be
            switched on/off by clicking on the label of the dataset, on the
            legend of the graph. 
        </p>
        <p style="margin-bottom: 0in; line-height: 115%"><br/>

        </p>
        <p style="margin-bottom: 0in; line-height: 115%"><br/>

        </p>
        <p style="margin-bottom: 0in; line-height: 115%"><br/>

        </p>
        <p align="center" style="margin-bottom: 0in; line-height: 115%"><img src="data:image/png;base64," name="image33.png" align="bottom" width="567" height="697" border="0"/>
        </p>
        <h1 class="western" style="margin-top: 0in; margin-bottom: 0in"><a name="_7s1k4z3r1tu5"></a>
            API</h1>
        <p style="margin-bottom: 0in; line-height: 115%">Under the hood of
            KPI app lies a PHP API, coded using Laravel 5.4, that handles all
            calculations. This API can be accessed by users to get single values
            or series of values for the KPIs available via single HTTP GET calls
            to the API. Then users can create their own visualizations or create
            their own analysis using this data. 
        </p>
