        <h1 class="western" style="margin-top: 0in; margin-bottom: 0in"><a name="_t9z6jcoptvcn"></a>
            Installation</h1>
        <h2 class="western" style="margin-top: 0in; margin-bottom: 0in"><a name="_ucgwxe2htx78"></a>
            Requirements</h2>
        <p style="margin-bottom: 0in; line-height: 115%">The app is built
            using Laravel 5.4 PHP MVC Framework. The requirements of the
            application to work properly are:</p>
        <ul>
            <li/>
            <p style="margin-bottom: 0in; line-height: 115%">PHP &gt;=
                5.6.4</p>
            <li/>
            <p style="margin-bottom: 0in; line-height: 115%">PDO PHP
                Extension</p>
            <li/>
            <p style="margin-bottom: 0in; line-height: 115%">Mbstring PHP
                Extension</p>
            <li/>
            <p style="margin-bottom: 0in; line-height: 115%">Tokenizer PHP
                Extension</p>
            <li/>
            <p style="margin-bottom: 0in; line-height: 115%">XML PHP
                Extension</p>
            <li/>
            <p style="margin-bottom: 0in; line-height: 115%">SQLite</p>
            <li/>
            <p style="margin-bottom: 0in; line-height: 115%"><a href="https://getcomposer.org/doc/00-intro.md"><font color="#1155cc"><u>Composer</u></font></a></p>
            <li/>
            <p style="margin-bottom: 0in; line-height: 115%"><a href="https://nodejs.org/en/download/"><font color="#1155cc"><u>Node.js</u></font></a></p>
        </ul>
        <p style="margin-bottom: 0in; line-height: 115%"><br/>

        </p>
        <h2 class="western" style="margin-top: 0in; margin-bottom: 0in"><a name="_8j50sssfbzux"></a>
            Building the app</h2>
        <ol>
            <li/>
            <p style="margin-bottom: 0in; line-height: 115%">First clone
                the application from Gitub.</p>
            <ol type="a">
                <li/>
                <p style="margin-bottom: 0in; line-height: 115%">git clone
                    <a href="https://github.com/okgreece/KPI.git"><font color="#1155cc"><u>https://github.com/okgreece/KPI.git</u></font></a></p>
            </ol>
            <li/>
            <p style="margin-bottom: 0in; line-height: 115%">A new folder
                will be created named KPIs. Then get into the folder</p>
            <ol type="a">
                <li/>
                <p style="margin-bottom: 0in; line-height: 115%"> cd KPIs</p>
            </ol>
            <li/>
            <p style="margin-bottom: 0in; line-height: 115%">Build the
                application</p>
            <ol type="a">
                <li/>
                <p style="margin-bottom: 0in; line-height: 115%">composer
                    install</p>
                <li/>
                <p style="margin-bottom: 0in; line-height: 115%">npm install</p>
                <li/>
                <p style="margin-bottom: 0in; line-height: 115%">gulp</p>
                <li/>
                <p style="margin-bottom: 0in; line-height: 115%">cp
                    .env.example .env</p>
            </ol>
        </ol>
        <h2 class="western" style="margin-top: 0in; margin-bottom: 0in"><a name="_4r5ttkqnhbyj"></a>
            Configuring the Environment</h2>
        <p style="margin-bottom: 0in; line-height: 115%">Edit the .env file
            to reflect your endpoint and other settings</p>
        <ol>
            <li/>
            <p style="margin-bottom: 0in; line-height: 115%">Declare your
                SPARQL Endpoint where to get your data</p>
            <ol type="a">
                <li/>
                <p style="margin-bottom: 0in; line-height: 115%">ENDPOINT=http://data.openbudgets.eu/sparql</p>
            </ol>
            <li/>
            <p style="margin-bottom: 0in; line-height: 115%">Declare the
                RUDOLF API Endpoint</p>
            <ol type="a">
                <li/>
                <p style="margin-bottom: 0in; line-height: 115%">RUDOLF =
                    <a href="http://eis-openbudgets.iais.fraunhofer.de/api/3/cubes/"><font color="#1155cc"><u>http://eis-openbudgets.iais.fraunhofer.de/api/3/cubes/</u></font></a></p>
            </ol>
            <li/>
            <p style="margin-bottom: 0in; line-height: 115%">Declare the
                OS-Viewer of the RUDOLF endpoint address 
            </p>
            <ol type="a">
                <li/>
                <p style="margin-bottom: 0in; line-height: 115%">OS_VIEWER =
                    <a href="http://eis-openbudgets.iais.fraunhofer.de/viewer/"><font color="#1155cc"><u>http://eis-openbudgets.iais.fraunhofer.de/viewer/</u></font></a></p>
            </ol>
        </ol>
        <h2 class="western" style="margin-top: 0in; margin-bottom: 0in"><a name="_dgob2x659ajm"></a>
            Seeding the database</h2>
        <p style="margin-bottom: 0in; line-height: 115%">From within KPIs
            folder run the following commands</p>
        <ol>
            <li/>
            <p style="margin-bottom: 0in; line-height: 115%">php artisan
                key:generate</p>
            <li/>
            <p style="margin-bottom: 0in; line-height: 115%">php artisan
                migrate</p>
            <li/>
            <p style="margin-bottom: 0in; line-height: 115%">php artisan
                db:seed</p>
        </ol>
        <p style="margin-bottom: 0in; line-height: 115%"><br/>

        </p>
        <h2 class="western" style="margin-top: 0in; margin-bottom: 0in"><a name="_nt7aqkg5ld96"></a>
            Run the Application</h2>
        <p style="margin-bottom: 0in; line-height: 115%">From within KPIs
            folder run the following commands</p>
        <ol>
            <li/>
            <p style="margin-bottom: 0in; line-height: 115%">php artisan
                serve</p>
        </ol>
        <p style="margin-bottom: 0in; line-height: 115%"><br/>

        </p>
        <p style="margin-bottom: 0in; line-height: 115%">The KPIs application
            will be available on localhost:9000 and the Admin Panel on
            localhost:9000/admin</p>
        <p style="margin-bottom: 0in; line-height: 115%"><br/>

        </p>
        <h2 class="western" style="margin-top: 0in; margin-bottom: 0in"><a name="_dgfe96ru3zk4"></a>
            Adding new languages</h2>
        <p style="margin-bottom: 0in; line-height: 115%">KPIs application
            comes with preinstalled translated UI in English and Greek. If you
            would like to translate in your language go to KPIs/resources/lang
            and copy the “en” folder. This folder contains all the strings
            required by the app. Name your folder following your language ISO
            Code e.g. for spanish name the folder “es”. Next, translate every
            string within this folder. For instance on kpi/form.php you will see
            a PHP array as the following 
        </p>
        <p style="margin-bottom: 0in; line-height: 115%">return [</p>
        <p style="margin-bottom: 0in; line-height: 115%"><br/>

        </p>
        <p style="margin-bottom: 0in; line-height: 115%">	/*</p>
        <p style="margin-bottom: 0in; line-height: 115%">	|--------------------------------------------------------------------------</p>
        <p style="margin-bottom: 0in; line-height: 115%">	| Forms Language
            Lines</p>
        <p style="margin-bottom: 0in; line-height: 115%">	|--------------------------------------------------------------------------</p>
        <p style="margin-bottom: 0in; line-height: 115%">	|</p>
        <p style="margin-bottom: 0in; line-height: 115%">	| The following
            language lines are used on forms</p>
        <p style="margin-bottom: 0in; line-height: 115%">	|</p>
        <p style="margin-bottom: 0in; line-height: 115%">	*/</p>
        <p style="margin-bottom: 0in; line-height: 115%"><br/>

        </p>
        <p style="margin-bottom: 0in; line-height: 115%">	'organization' =&gt;
            'Organization',</p>
        <p style="margin-bottom: 0in; line-height: 115%">	'year' =&gt;
            'Year',</p>
        <p style="margin-bottom: 0in; line-height: 115%">	'phase' =&gt;
            'Phase',</p>
        <p style="margin-bottom: 0in; line-height: 115%">	'indicator' =&gt;
            'Indicator',</p>
        <p style="margin-bottom: 0in; line-height: 115%">	'helper' =&gt;
            'Select a dimension',</p>
        <p style="margin-bottom: 0in; line-height: 115%">	'compare_label1' =&gt;
            'Select Fixed Dimension 1',</p>
        <p style="margin-bottom: 0in; line-height: 115%">	'compare_label2' =&gt;
            'Select Fixed Dimension 2',</p>
        <p style="margin-bottom: 0in; line-height: 115%">	'compare_label3' =&gt;
            'Select Fixed Dimension 3',</p>
        <p style="margin-bottom: 0in; line-height: 115%">    
        </p>
        <p style="margin-bottom: 0in; line-height: 115%">];</p>
        <p style="margin-bottom: 0in; line-height: 115%"><br/>

        </p>
        <p style="margin-bottom: 0in; line-height: 115%">In order to provide
            a translation on the ‘’organization change the value after ‘=&gt;’.
            So for spanish it could be 
        </p>
        <p style="margin-bottom: 0in; line-height: 115%"><br/>

        </p>
        <p style="margin-bottom: 0in; line-height: 115%">'organization' =&gt;
            'Organización’,</p>
        <p style="margin-bottom: 0in; line-height: 115%"><br/>

        </p>
        <p style="margin-bottom: 0in; line-height: 115%">Continue to
            translate every string on all files. If a string is not translated,
            it will fallback in english language. 
        </p>
        <p style="margin-bottom: 0in; line-height: 115%"><br/>

        </p>
        <p style="margin-bottom: 0in; line-height: 115%">After you have
            translated all instances, you have to tell the app that the spanish
            language is available. Head to KPIs/config/lang-detector.php and
            change the following setting</p>
        <p style="margin-bottom: 0in; line-height: 115%"><br/>

        </p>
        <p style="margin-bottom: 0in; line-height: 115%">'languages' =&gt;
            parse_langs_to_array(</p>
        <p style="margin-bottom: 0in; line-height: 115%">   
            env('LANG_DETECTOR_LANGUAGES',</p>
        <p style="margin-bottom: 0in; line-height: 115%">   	 [</p>
        <p style="margin-bottom: 0in; line-height: 115%">   		 'en',</p>
        <p style="margin-bottom: 0in; line-height: 115%">   		 'el',</p>
        <p style="margin-bottom: 0in; line-height: 115%">   	 ]</p>
        <p style="margin-bottom: 0in; line-height: 115%">    	)</p>
        <p style="margin-bottom: 0in; line-height: 115%">	),</p>
        <p style="margin-bottom: 0in; line-height: 115%">Add ‘es’, after
            ‘el,’ . Now, when a user requests the app, the language detector
            will detect the language of the user based on the browser settings
            and render the UI with the translated strings. 
        </p>
        <p style="margin-bottom: 0in; line-height: 115%">  
        </p>
        <h2 class="western" style="margin-top: 0in; margin-bottom: 0in"><a name="_mx26jg6uq1iw"></a>
            Changing Color Scheme</h2>
        <h1 class="western" style="margin-top: 0in; margin-bottom: 0in"><a name="_4gp85yc4ddkj"></a>
            Adding new admin users</h1>
        <p style="margin-bottom: 0in; line-height: 115%">Go to
            localhost:9000/admin. Choose the register link. A registration form
            will be presented.</p>
        <p align="center" style="margin-bottom: 0in; line-height: 115%"><img src="data:image/png;base64," name="image11.png" align="bottom" width="624" height="283" border="0"/>
        </p>
        <p style="margin-bottom: 0in; line-height: 115%">Enter a name, an
            e-mail and your password twice and click on register. A new User
            profile will be created. Go to the login page and enter our
            credentials to access the admin panel.</p>
        <p style="margin-bottom: 0in; line-height: 115%"><br/>

        </p>
        <p align="center" style="margin-bottom: 0in; line-height: 115%"><img src="data:image/png;base64," name="image26.png" align="bottom" width="624" height="244" border="0"/>
        </p>
        <p style="margin-bottom: 0in; line-height: 115%"><br/>

        </p>
        <h1 class="western" style="margin-top: 0in; margin-bottom: 0in"><a name="_7nr3dtlg7lva"></a>
            Selecting Organizations</h1>
        <p style="margin-bottom: 0in; line-height: 115%">SPARQL Endpoints may
            contain various fiscal datasets describe using the OBEU data model.
            You can select the organization’s dataset you would like to serve
            through the app, via the Admin Panel. To enable organizations,
            available on your or a remote SPARQL endpoint, go to “Organizations”
            page. 
        </p>
        <p style="margin-bottom: 0in; line-height: 115%"><br/>

        </p>
        <p align="center" style="margin-bottom: 0in; line-height: 115%"><img src="data:image/png;base64," name="image15.png" align="bottom" width="556" height="396" border="0"/>
        </p>
        <p style="margin-bottom: 0in; line-height: 115%">Click on “Add
            New”. Select an organization from the list of the available
            organizations. Don’t forget to enable it and click on “Create”
            button.</p>
        <p style="margin-bottom: 0in; line-height: 115%"><br/>

        </p>
        <p align="center" style="margin-bottom: 0in; line-height: 115%"><img src="data:image/png;base64," name="image17.png" align="bottom" width="521" height="190" border="0"/>
        </p>
        <p style="margin-bottom: 0in; line-height: 115%">All enabled
            Organizations will be shown on the KPIs Dashboard and other pages. 
        </p>
        <h1 class="western" style="margin-top: 0in; margin-bottom: 0in"><a name="_x40xv9f2mnv5"></a>
            Creating Aggregators</h1>
        <p style="margin-bottom: 0in; line-height: 115%">Indicators are
            composed by simple aggregations divisions or divisions of
            aggregations with census data. In order to build Indicators you first
            have to define aggregators, that will be used as numerators or
            denominators in an aggregator definition. 
        </p>
        <p style="margin-bottom: 0in; line-height: 115%">Aggregators are
            Observation aggregations, based on the Economic Classification
            dimension or census data coming from the LOD cloud. Go to the
            “Aggregators” page on the Admin Panel to manage aggregators or
            create new ones. 
        </p>
        <p style="margin-bottom: 0in; line-height: 115%"><br/>

        </p>
        <p align="center" style="margin-bottom: 0in; line-height: 115%"><img src="data:image/png;base64," name="image09.png" align="bottom" width="624" height="413" border="0"/>
        </p>
        <p style="margin-bottom: 0in; line-height: 115%">To create a new
            Aggregator click on the “+” button. 
        </p>
        <p align="center" style="margin-bottom: 0in; line-height: 115%"><img src="data:image/png;base64," name="image24.png" align="bottom" width="624" height="713" border="0"/>
        </p>
        <p style="margin-bottom: 0in; line-height: 115%">Give an alias on the
            aggregator. Use lowercase latin alphabet letters without space. These
            will be used by the API. Give a title and a short description of the
            aggregator on all languages you have enabled for the app. 
        </p>
        <p style="margin-bottom: 0in; line-height: 115%"><br/>

        </p>
        <p style="margin-bottom: 0in; line-height: 115%">On the “Included”
            textarea, insert comma separated values of Economic Classification
            Dimension notations. In the case of Greek Municipalities these came
            from the KAE(Numerical Coded Expenditure/Revenue Classification)
            classification codelist, so we declare also the codelist on the
            according field. The “Included set denotes that these entities and
            their narrower relatives will be included in the aggregation. 
        </p>
        <p style="margin-bottom: 0in; line-height: 115%"><br/>

        </p>
        <p style="margin-bottom: 0in; line-height: 115%">Insert comma
            separated values of Economic Classification Dimension notations on
            the “Excluded” textarea to denote values that should be excluded,
            if any. Those and their narrower relatives will be excluded from the
            aggregation.</p>
        <p style="margin-bottom: 0in; line-height: 115%"><br/>

        </p>
        <p style="margin-bottom: 0in; line-height: 115%">Then click on Create
            to create your new Aggregator. Aggregators can be updated or deleted
            using the same page.  
        </p>
        <p style="margin-bottom: 0in; line-height: 115%"><br/>

        </p>
        <p style="margin-bottom: 0in; line-height: 115%">In case you need
            census data from an endpoint create a new Aggregator as follows.</p>
        <p align="center" style="margin-bottom: 0in; line-height: 115%"><img src="data:image/png;base64," name="image07.png" align="bottom" width="467" height="526" border="0"/>
        </p>
        <p style="margin-bottom: 0in; line-height: 115%">On the “Included”
            area enter enter the property you want to use, and on the codelist
            field, enter the endpoint(s) to use and click on create. 
        </p>
        <h1 class="western" style="margin-top: 0in; margin-bottom: 0in"><a name="_o5ms5k69bitl"></a>
            Creating Indicator Groups</h1>
        <p style="margin-bottom: 0in; line-height: 115%">Indicators can be
            classified in groups. To create a new group or manage your existing
            groups go on “Groups” page. 
        </p>
        <p align="center" style="margin-bottom: 0in; line-height: 115%"><img src="data:image/png;base64," name="image16.png" align="bottom" width="624" height="275" border="0"/>
        </p>
        <p style="margin-bottom: 0in; line-height: 115%">Give a simple alias
            in lowercase latin alphabet letters without spaces or special
            characters and give a title and simple descriptions for each of the
            language you have defined on the language detector. 
        </p>
        <h1 class="western" style="margin-top: 0in; margin-bottom: 0in"><a name="_ksgn0dq3akzz"></a>
            Creating Indicators</h1>
        <p align="left" style="margin-bottom: 0in; line-height: 115%">To
            create a new indicator or manage your existing indicators go on
            “Indicators” page.</p>
        <p align="center" style="margin-bottom: 0in; line-height: 115%"> 
            <img src="data:image/png;base64," name="image14.png" align="bottom" width="572" height="291" border="0"/>
        </p>
        <p style="margin-bottom: 0in; line-height: 115%"><br/>

        </p>
        <p style="margin-bottom: 0in; line-height: 115%">Click on the “+”
            button. 
        </p>
        <p align="center" style="margin-bottom: 0in; line-height: 115%"><img src="data:image/png;base64," name="image18.png" align="bottom" width="624" height="571" border="0"/>
        </p>
        <p style="margin-bottom: 0in; line-height: 115%">On the “Indicator”
            field insert a lowercase latin alphabet value. This will be used as a
            reference for the API. Next provide a title and a description for
            each language you have enabled on the language detector module. 
        </p>
        <p style="margin-bottom: 0in; line-height: 115%"><br/>

        </p>
        <p style="margin-bottom: 0in; line-height: 115%">Select a group from
            the  groups you have created earlier. If you have not created any,
            this process will fail. 
        </p>
        <p style="margin-bottom: 0in; line-height: 115%"><br/>

        </p>
        <p style="margin-bottom: 0in; line-height: 115%">Select Enabled if
            you want the Indicator to show up on the dashboard. 
        </p>
        <p style="margin-bottom: 0in; line-height: 115%"><br/>

        </p>
        <p style="margin-bottom: 0in; line-height: 115%">The reverse option
            indicates if a high value of the indicator has a positive meaning, or
            the opposite. In some cases indicator value of near 100% has a
            positive meaning, eg Autonomy Indicator, whilst in other cases would
            indicate bad performance eg. on Operational Expenses indicator</p>
        <p align="center" style="margin-bottom: 0in; line-height: 115%"><img src="data:image/png;base64," name="image10.png" align="bottom" width="216" height="209" border="0"/>
        </p>
        <p style="margin-bottom: 0in; line-height: 115%">The reverse option
            will reflect this on the color of the gauge. 
        </p>
        <p style="margin-bottom: 0in; line-height: 115%"><br/>

        </p>
        <p style="margin-bottom: 0in; line-height: 115%">Next step is to
            define the type of the Indicator. There are three type of indicators
            you can select from. “Percent” for aggregation ratios, “Numeric”
            for numerical representations and Structural for indicators that
            should be represented as barcharts or pie charts eg “Expenditure
            Structure” or “Revenue Structure”. 
        </p>
        <p style="margin-bottom: 0in; line-height: 115%"><br/>

        </p>
        <table width="624" cellpadding="7" cellspacing="0">
            <col width="297">
            <col width="297">
            <tr valign="top">
                <td width="297" style="border: 1.00pt solid #000001; padding: 0.07in">
                    <p align="center" style="page-break-inside: auto; orphans: 0; widows: 0; page-break-after: auto">
                        <b>Indicator Type</b></p>
                </td>
                <td width="297" style="border: 1.00pt solid #000001; padding: 0.07in">
                    <p align="center" style="page-break-inside: auto; orphans: 0; widows: 0; page-break-after: auto">
                        <b>Visualization Type</b></p>
                </td>
            </tr>
            <tr>
                <td width="297" style="border: 1.00pt solid #000001; padding: 0.07in">
                    <p align="center" style="page-break-inside: auto; orphans: 0; widows: 0; page-break-after: auto">
                        Percent</p>
                </td>
                <td width="297" valign="top" style="border: 1.00pt solid #000001; padding: 0.07in">
                    <p align="center" style="margin-bottom: 0in"><img src="data:image/png;base64," name="image21.png" align="bottom" width="216" height="209" border="0"/>
                    </p>
                    <p align="center"><b>Gauge</b></p>
                </td>
            </tr>
            <tr>
                <td width="297" style="border: 1.00pt solid #000001; padding: 0.07in">
                    <p align="center" style="page-break-inside: auto; orphans: 0; widows: 0; page-break-after: auto">
                        Number</p>
                </td>
                <td width="297" valign="top" style="border: 1.00pt solid #000001; padding: 0.07in">
                    <p align="center" style="margin-bottom: 0in; page-break-inside: auto; orphans: 0; widows: 0; page-break-after: auto">
                        <img src="data:image/png;base64," name="image25.png" align="bottom" width="247" height="239" border="0"/>
                    </p>
                    <p align="center" style="page-break-inside: auto; orphans: 0; widows: 0; page-break-after: auto">
                        Odometer</p>
                </td>
            </tr>
            <tr>
                <td width="297" style="border: 1.00pt solid #000001; padding: 0.07in">
                    <p align="center" style="page-break-inside: auto; orphans: 0; widows: 0; page-break-after: auto">
                        Structural</p>
                </td>
                <td width="297" valign="top" style="border: 1.00pt solid #000001; padding: 0.07in">
                    <p align="left" style="page-break-inside: auto; orphans: 0; widows: 0; page-break-after: auto">
                        <img src="data:image/png;base64," name="image20.png" align="bottom" width="250" height="282" border="0"/>
                    </p>
                </td>
            </tr>
        </table>
        <p style="margin-bottom: 0in; line-height: 115%"><br/>

        </p>
        <p style="margin-bottom: 0in; line-height: 115%">The final step is to
            define the Numerator and Denominator of the ratio to calculate the
            indicator. Select a Numerator from the available aggregators and a
            Denominator and click on “Create” button. Your newly created
            Indicator will be available on the dashboard and every other  page of
            KPI. 
        </p>
        <p style="margin-bottom: 0in; line-height: 115%"><br/>

        </p>
    </div>
